// --- inishe_epsp_f.cfg ---

ATTRIBUTES(COMMON)
{
    // INPUT ATTRIBUTES
    inishe_epsp_f_count                = SIZE("inishe_epsp_f_count");
    INISHE_EPSP_F_SUBOBJ               = ARRAY[inishe_epsp_f_count](SUBOBJECT, "List of keys/items");

    // HM INTERNAL
    KEYWORD_STR                        = VALUE(STRING, "List of keys/items");
}

SKEYWORDS_IDENTIFIER(COMMON)
{
    //INPUT ATTRIBUTES
    inishe_epsp_f_count                = -1;
    INISHE_EPSP_F_SUBOBJ               = -1;

    //HM INTERNAL
    KEYWORD_STR                        = 9000;
}


GUI(COMMON)
{
    ASSIGN(KEYWORD_STR, "/INISHE/EPSP_F/");

    SUBOBJECT(INISHE_EPSP_F_SUBOBJ)     { SUBTYPES = ( /SUBOBJECT/INISHE_EPSP_F_SUBOBJ ) ; }
}

// File format
FORMAT(radioss51)
{
    HEADER("/INISHE/EPSP_F/");
    SUBOBJECTS(INISHE_EPSP_F_SUBOBJ, /SUBOBJECT/INISHE_EPSP_F_SUBOBJ);
}